SET client_encoding = 'UTF8';
SET standard_conforming_strings = off;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET escape_string_warning = off;
SET default_tablespace = '';
SET default_with_oids = false;


------------------------------------------------------------------------
-- table definitions ---------------------------------------------------
------------------------------------------------------------------------

-- table cablegate_media -----------------------------------------------

CREATE TABLE cablegate_media (
	media_id    CHAR(3) PRIMARY KEY,
	media_en    VARCHAR(30),
	media_nt    VARCHAR(30),
	sort_en     VARCHAR(30) UNIQUE,
	country_id  CHAR(2),
	lng_id      CHAR(2),
	url         VARCHAR(40)
);

COMMENT ON TABLE cablegate_media IS 'Cablegate: publishing media';
COMMENT ON COLUMN cablegate_media.media_id IS 'media key (PK)';
COMMENT ON COLUMN cablegate_media.media_en IS 'plain text name, english';
COMMENT ON COLUMN cablegate_media.media_nt IS 'plain text name, native language';
COMMENT ON COLUMN cablegate_media.sort_en IS 'alphabetic sort order, english';
COMMENT ON COLUMN cablegate_media.country_id IS 'country code (ISO 3166-1)';
COMMENT ON COLUMN cablegate_media.lng_id IS 'language code (ISO 639-1)';
COMMENT ON COLUMN cablegate_media.url IS 'homepage url';


-- table cablegate_articles --------------------------------------------

CREATE TABLE cablegate_articles (
	art_id      CHAR(7) PRIMARY KEY,
	media_id    CHAR(3) REFERENCES cablegate_media,
	pubdate     INTEGER,
	headline    TEXT,
	url         VARCHAR UNIQUE,
	lng_id      CHAR(2)
);

COMMENT ON TABLE cablegate_articles IS 'Cablegate: related articles';
COMMENT ON COLUMN cablegate_articles.art_id IS 'alphanumeric id, media_id || 9999';
COMMENT ON COLUMN cablegate_articles.media_id IS 'publishing media (FK)';
COMMENT ON COLUMN cablegate_articles.pubdate IS 'publication date, YYYYMMDD';
COMMENT ON COLUMN cablegate_articles.headline IS 'article headline';
COMMENT ON COLUMN cablegate_articles.url IS 'article source url';
COMMENT ON COLUMN cablegate_articles.lng_id IS 'language code (ISO 639-1)';


-- table cablegate_ref -------------------------------------------------

CREATE TABLE cablegate_ref (
	art_id      CHAR(7) REFERENCES cablegate_articles,
	ref_id      VARCHAR(40)
);

ALTER TABLE ONLY cablegate_ref
	ADD CONSTRAINT cablegate_ref_pkey PRIMARY KEY (art_id, ref_id);

COMMENT ON TABLE cablegate_ref IS 'Cablegate: cross table articles/cables';
COMMENT ON COLUMN cablegate_ref.art_id IS 'article id (FK)';
COMMENT ON COLUMN cablegate_ref.ref_id IS 'cable reference id';


